import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function EventsComp(){
    return(
        <div>
            <Container>
                <Row>
                    <Col>
                    Upcoming Events
                    </Col>
                </Row>
            </Container>
        </div>
    )
};

export default EventsComp;
